import React from 'react';
import DataTable from './DataTable';

const DisplayContent = () => {
    return ( 
        <Grid item="container" direction="column">
            <Grid>HELLO</Grid>
            <Grid>BYE</Grid>
            <Grid> <DataTable/></Grid>
        </Grid>
     );
}

export default DisplayContent;
